        const msg = firebase.messaging();
        msg.requestPermisson().then(()=>{
            return msg.getToken();
        }).then((data)=>{
            console.warn("token",data)
        })
    })
    return (
        <div>
            <h1>dfdf</h1>
        </div>
    )
}

export default Nontification
